import React from 'react';
import '../../components/common/TopRankPageLayout.css';
import '../../components/common/2columns_layout.css';
import '../../components/common/PlaceBox.css';
import './TopProvince.css';
import arrow from '../../images/TopProvince/12_arrow-right.png';
import Navbar from '../../components/common/navbar';
// import styled from 'styled-components';

function topprovince() {
    return (
        <div class="top layout placeBox">
            <Navbar />
            <div class="BGimg" />
            <div class="LayOut">
                <div class="PageTitle">Popular Province</div>
                <div class="PageBreadCrumbs">Home&emsp;|&emsp;Popular Province</div>
                <div class="Title">Top 10  Provinces <br /> in Thailand</div>
                <div class="row">
                    <div class="column">
                        <div class="container">
                            <div class="Picture01" />
                            <div class="TextBox">
                                <div class="RankTop">1 ST</div>
                                <div class="PlaceName">Phuket</div>
                                <div class="PlaceDesc">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text</div>
                            </div>
                            <button class="NextButton">
                                <img src={arrow} />
                            </button>
                        </div>
                    </div>
                    <div class="column">
                        <div class="container">
                            <div class="Picture02" />
                            <div class="TextBox">
                                <div class="RankTop">1 ST</div>
                                <div class="PlaceName">Phuket</div>
                                <div class="PlaceDesc">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text</div>
                            </div>
                            <button class="NextButton">
                                <img src={arrow} />
                            </button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default topprovince;
